import React from 'react'
import {
    BrowserRouter as Router,
    Switch,
    Route,
    useParams
  } from "react-router-dom";
const Test = () => {
    return (
        <div>
              <Router>
    <Switch>
      <Route exact path="/">
        return <HomePage/>
      </Route>
      <Route path="/blog/:slug">
        <BlogPost />
      </Route>
    </Switch>
        </Router>
      </div>
    )
    function BlogPost() {
        let { slug } = useParams();
        return <div>Now showing post {slug}</div>;
      }
      function HomePage() {
          let { slug } = useParams();
          return <div>Now showing home page {slug}</div>;
        }
      
}

export default Test
